import React from 'react';
import { Switch , Route } from 'react-router-dom';
import Home_Page from './Home_Page';
import NFT_Page from './NFT_Page';
import Games_Page from './Games_Page';
import Contact_Page from './Contact_Page';
import About_Page from './About_Page';
import FilterGallery from './FilterGallery';

function Pages(){
    return(
        <>
            <Switch>
                <Route exact path='/' component={Home_Page} />
                <Route exact path='/nft' component={NFT_Page} />
                <Route exact path='/games' component={Games_Page} />
                <Route exact path='/contact' component={Contact_Page} />
                <Route exact path='/about' component={About_Page} />
                <Route exact path='/about' component={About_Page} />
                <Route exact path='/about' component={About_Page} />
            </Switch>
        </>
    )
}

export default Pages;
